#include "../hooks.h"

namespace hooks
{
    bool __stdcall create_move::hook(float input_sample_frametime, c_usercmd* cmd)
    {
        bool result = o_create_move(g_client_mode, input_sample_frametime, cmd);

        if (!cmd || !cmd->command_number || g_unload)
            return result;

        if (menu::is_visible())
            cmd->buttons &= ~(IN_ATTACK | IN_ATTACK2);

        int old_flags = g_local_player->m_fFlags();


        misc::fast_duck(cmd);
        misc::moon_walk(cmd);
        misc::prepare_revolver(cmd);
        misc::bhop::on_create_move(cmd);
        misc::bhop::auto_strafe(cmd, cmd->viewangles);
        misc::bhop::human_bhop(cmd);
        misc::disable_flash_alpha();
        misc::performance::remove_3dsky();
        misc::performance::remove_shadows();
        misc::performance::remove_processing();
        misc::doorspam(cmd);

        //--------------------------------------------------DEFINATIONS-------------------------------------------------------------------------//

        engine_prediction::type1::begin(cmd);
        {

            misc::block_bot(cmd);
            misc::edge_jump(cmd, old_flags);

            if (settings::misc::fast_stop)
                misc::fast_stop(cmd);

            if (settings::misc::lefthandknife)
                misc::KnifeLeft();

            misc::jumpbug(cmd);
            misc::edgebug(cmd);
            misc::runboost(cmd);
            legit_aimbot::on_move(cmd);

            backtrack::on_move(cmd);
            legit_aimbot::trigger(cmd);

            grenade_prediction::tick(cmd->buttons);

    

            static auto weapon_debug_spread_show = g_cvar->find_var("weapon_debug_spread_show");


            weapon_debug_spread_show->set_value((settings::misc::visuals_crosshair && !g_local_player->m_bIsScoped() && g_local_player->m_hActiveWeapon() && g_local_player->m_hActiveWeapon()->is_sniper()) ? 3 : 0);
            cmd->viewangles.Normalize();


            return false;
        }
        engine_prediction::type1::end();

        engine_prediction::type2::start(cmd);
        {
        }
        engine_prediction::type2::finish(cmd);



    }

}














































































